{"3": ["Обман! Товар не соответствует тому что на фото! Обычные синие лампы, которые в любом автомагазине можно купить за 150р. Лохотрон. Освещение от них вообще ужасное. Толка нет!", "2021-01-28T17:05:27Z", "прозрачный", "0", 0, 2, 1, "Лампа H3 12V-55W WhiteLight (2 шт.)", "Clearlight"], "4": ["Лампы мне понравились, дорогу освещают хорошо, свет действительно белый и комфортный, глаз не режет, за такую стоимость просто отличный вариант.", "2020-12-22T12:44:40Z", "прозрачный", "0", 1, 0, 5, "Лампа H3 12V-55W WhiteLight (2 шт.)", "Clearlight"], "7": ["Светит хорошо лучше чем ближний", "2020-12-17T17:22:43Z", "прозрачный", "0", 1, 0, 5, "Лампа H3 12V-55W WhiteLight (2 шт.)", "Clearlight"], "9": ["Отличные лампы, светят ярким белым светом, на дороге всё видно даже в плохую погоду, пожалуй, лучший вариант за такую цену.", "2020-11-27T06:26:08Z", "прозрачный", "0", 1, 0, 5, "Лампа H3 12V-55W WhiteLight (2 шт.)", "Clearlight"], "10": ["Пустая коробочка.", "2020-11-09T14:50:43Z", "прозрачный", "0", 0, 1, 1, "Лампа H3 12V-55W WhiteLight (2 шт.)", "Clearlight"], "14": ["Пусто)))))", "2020-11-03T11:55:33Z", "прозрачный", "0", 0, 2, 1, "Лампа H3 12V-55W WhiteLight (2 шт.)", "Clearlight"], "19": ["Очень хорошие лампы, поставил в птф ваз 2115, светят белым очень ярко", "2020-08-26T21:37:02Z", "прозрачный", "0", 1, 0, 5, "Лампа H3 12V-55W WhiteLight (2 шт.)", "Clearlight"], "22": ["Свет белый но слабый и самый главный минус это что цоколь надо доработать напильником! Тойота. Фары (оригинал).", "2020-07-05T16:31:45.366709153Z", "прозрачный", "0", 0, 1, 2, "Лампа H3 12V-55W WhiteLight (2 шт.)", "Clearlight"], "24": ["Лампы приятные, приехали быстро. Упакованы очень хорошо, в плотную пластиковую коробку. Оттенок красивый, я довольна.", "2020-07-06T07:13:50.121280565Z", "прозрачный", "0", 0, 1, 5, "Лампа H3 12V-55W WhiteLight (2 шт.)", "Clearlight"], "26": ["Лампы хорошие, свет от них очень приятный. белый без каких-либо оттенков. Посмотрим, сколько эти прослужат. Покупаем их уже второй раз (прошлые не в вайлдберисе брали), проходили 9 месяцев тогда. Вот решили заново такие же взять, показали себя с хорошей стороны.", "2020-04-30T09:46:00.184912249Z", "прозрачный", "0", 1, 0, 5, "Лампа H3 12V-55W WhiteLight (2 шт.)", "Clearlight"], "29": ["Отличные лампочки, рекомендую! Вчера установил и сразу заказал ещё одни на запас!", "2020-05-23T09:53:28.761575826Z", "прозрачный", "0", 2, 0, 5, "Лампа H3 12V-55W WhiteLight (2 шт.)", "Clearlight"], "30": ["Галогенки годные, покупаю уже второй раз. Раньше покупал в другом магазине (офлайн). Сейчас все закрыто, заказал тут. В прошлый раз с ними проблем не было никаких, отходили месяцев 7-8. Супер яркости +200 и не ждал от них. Беру ради красивого оттенка фар. Лампы приехали в хорошем состоянии, колбы припаяны ровно. Пока что еще не установил, потом дополню отзыв.", "2020-05-19T14:17:42.736372291Z", "прозрачный", "0", 2, 0, 5, "Лампа H3 12V-55W WhiteLight (2 шт.)", "Clearlight"], "31": ["Всё пришло быстро на следующий день упаковано аккуратно", "2020-04-14T02:28:28.774078353Z", "прозрачный", "0", 1, 0, 5, "Лампа H3 12V-55W WhiteLight (2 шт.)", "Clearlight"], "32": ["Не советую,лампочки *.Хуже даже моих старых,еле еле светят.", "2020-03-29T03:49:20.073692811Z", "прозрачный", "0", 0, 1, 1, "Лампа H3 12V-55W WhiteLight (2 шт.)", "Clearlight"], "33": ["В общем заказал лампочки в Туманки, все дошло хорошо, все хорошо запаковано, все работает исправно, только не советую потому что цена накручена в4-5 раз, в автомагазинах такие лампочки можно найти за 40-60₽ за шт. , светят одинаково, цвет одинаковый, но цена только за упаковку видимо(", "2020-03-26T10:29:39.090519543Z", "прозрачный", "0", 1, 4, 1, "Лампа H3 12V-55W WhiteLight (2 шт.)", "Clearlight"], "34": ["Месяц даже не отработали, сгорели", "2020-03-15T18:17:43.080687926Z", "прозрачный", "0", 0, 3, 1, "Лампа H3 12V-55W WhiteLight (2 шт.)", "Clearlight"], "35": ["Отличные лампочки, ярко белого свечения! В разы ярче стандартной галогенки!", "2020-01-15T21:46:35.42534875Z", "прозрачный", "0", 2, 0, 5, "Лампа H3 12V-55W WhiteLight (2 шт.)", "Clearlight"], "36": ["И месяца не поработала одна лампочка  перегорела.", "2020-01-08T18:37:07.528333895Z", "прозрачный", "0", 0, 4, 2, "Лампа H3 12V-55W WhiteLight (2 шт.)", "Clearlight"], "37": ["Товар пришёл в целости и сохранности. Уже поставил лампочки . Светят хорошо. На замену штатным вполне пригодны.", "2020-01-02T06:23:12.008441477Z", "прозрачный", "0", 2, 0, 5, "Лампа H3 12V-55W WhiteLight (2 шт.)", "Clearlight"]}
